export const ForecastHour = ({ temp, month, day, hour, icon }) => {
  const iconUrl = `https://openweathermap.org/img/w/${icon}.png`;

  return (
    <div>
      <p>
        {day}.{month}
      </p>
      <img src={iconUrl} alt={temp} />
      <p>{hour}:00</p>
      <p>Температура: {temp}</p>
    </div>
  );
};
